(23,1,"2018-12-13 11:33:29","2018-12-13 11:33:29","<!-- wp:paragraph -->\n<p>\n\nA&nbsp;<strong>flower</strong>, sometimes known as a&nbsp;<strong>bloom</strong>&nbsp;or&nbsp;<strong><a href=\"https://en.wikipedia.org/wiki/Blossom\">blossom</a></strong>, is the&nbsp;<a href=\"https://en.wikipedia.org/wiki/Reproduction\">reproductive</a>&nbsp;structure found in&nbsp;<a href=\"https://en.wikipedia.org/wiki/Flowering_plant\">flowering plants</a>&nbsp;(plants of the division&nbsp;<a href=\"https://en.wikipedia.org/wiki/Magnoliophyta\">Magnoliophyta</a>, also called angiosperms). The biological function of a flower is to effect reproduction, usually by providing a mechanism for the union of sperm with eggs. Flowers may facilitate outcrossing (fusion of sperm and eggs from different individuals in a population) or allow selfing (fusion of sperm and egg from the same flower). Some flowers produce&nbsp;<a href=\"https://en.wikipedia.org/wiki/Diaspore_(botany)\">diaspores</a>&nbsp;without fertilization (<a href=\"https://en.wikipedia.org/wiki/Parthenocarpy\">parthenocarpy</a>). Flowers contain&nbsp;<a href=\"https://en.wikipedia.org/wiki/Sporangium\">sporangia</a>&nbsp;and are the site where&nbsp;<a href=\"https://en.wikipedia.org/wiki/Gametophyte\">gametophytes</a>&nbsp;develop. Many flowers have evolved to be attractive to animals, so as to cause them to be vectors for the transfer of&nbsp;<a href=\"https://en.wikipedia.org/wiki/Pollen\">pollen</a>. After fertilization, the&nbsp;<a href=\"https://en.wikipedia.org/wiki/Ovary_(botany)\">ovary</a>&nbsp;of the flower develops into&nbsp;<a href=\"https://en.wikipedia.org/wiki/Fruit\">fruit</a>&nbsp;containing&nbsp;<a href=\"https://en.wikipedia.org/wiki/Seed\">seeds</a>.\n\n</p>\n<!-- /wp:paragraph -->","Our history","","publish","open","closed","","our-history","","","2018-12-14 08:22:04","2018-12-14 08:22:04","",17,"http://tory-wordpress-site.local/?page_id=23",1,"page","",0),
(24,1,"2018-12-13 11:33:29","2018-12-13 11:33:29","<!-- wp:paragraph -->\n<p>\n\nA&nbsp;<strong>flower</strong>, sometimes known as a&nbsp;<strong>bloom</strong>&nbsp;or&nbsp;<strong><a href=\"https://en.wikipedia.org/wiki/Blossom\">blossom</a></strong>, is the&nbsp;<a href=\"https://en.wikipedia.org/wiki/Reproduction\">reproductive</a>&nbsp;structure found in&nbsp;<a href=\"https://en.wikipedia.org/wiki/Flowering_plant\">flowering plants</a>&nbsp;(plants of the division&nbsp;<a href=\"https://en.wikipedia.org/wiki/Magnoliophyta\">Magnoliophyta</a>, also called angiosperms). The biological function of a flower is to effect reproduction, usually by providing a mechanism for the union of sperm with eggs. Flowers may facilitate outcrossing (fusion of sperm and eggs from different individuals in a population) or allow selfing (fusion of sperm and egg from the same flower). Some flowers produce&nbsp;<a href=\"https://en.wikipedia.org/wiki/Diaspore_(botany)\">diaspores</a>&nbsp;without fertilization (<a href=\"https://en.wikipedia.org/wiki/Parthenocarpy\">parthenocarpy</a>). Flowers contain&nbsp;<a href=\"https://en.wikipedia.org/wiki/Sporangium\">sporangia</a>&nbsp;and are the site where&nbsp;<a href=\"https://en.wikipedia.org/wiki/Gametophyte\">gametophytes</a>&nbsp;develop. Many flowers have evolved to be attractive to animals, so as to cause them to be vectors for the transfer of&nbsp;<a href=\"https://en.wikipedia.org/wiki/Pollen\">pollen</a>. After fertilization, the&nbsp;<a href=\"https://en.wikipedia.org/wiki/Ovary_(botany)\">ovary</a>&nbsp;of the flower develops into&nbsp;<a href=\"https://en.wikipedia.org/wiki/Fruit\">fruit</a>&nbsp;containing&nbsp;<a href=\"https://en.wikipedia.org/wiki/Seed\">seeds</a>.\n\n</p>\n<!-- /wp:paragraph -->","Our history","","inherit","closed","closed","","23-revision-v1","","","2018-12-13 11:33:29","2018-12-13 11:33:29","",23,"http://tory-wordpress-site.local/23-revision-v1/",0,"revision","",0),
(25,1,"2018-12-13 11:35:25","2018-12-13 11:35:25","<!-- wp:list -->\n<ul><li><strong>State each goal as a positive statement –&nbsp;</strong>Express your goals positively – \"Execute this technique well\" is a much better goal than \"Don\'t make this stupid mistake.\"</li><li><strong>Be precise&nbsp;–&nbsp;</strong>Set precise goals, putting in dates, times and amounts so that you can measure achievement. If you do this, you\'ll know exactly when you have achieved the goal, and can take complete satisfaction from having achieved it.</li><li><strong>Set priorities –&nbsp;</strong>When you have several goals, give each a priority. This helps you to avoid feeling overwhelmed by having too many goals, and helps to direct your attention to the most important ones.</li><li><strong>Write goals down –&nbsp;</strong>This crystallizes them and gives them more force.</li><li><strong>Keep operational goals small –&nbsp;</strong>Keep the low-level goals that you\'re working towards small and achievable. If a goal is too large, then it can seem that you are not making progress towards it. Keeping goals small and incremental gives more opportunities for reward.</li><li><strong>Set performance goals, not outcome goals</strong>&nbsp;– You should take care to set goals over which you have as much control as possible. It can be quite dispiriting to fail to achieve a personal goal for reasons beyond your control!In business, these reasons could be bad business environments or unexpected effects of government policy. In sport, they could include poor judging, bad weather, injury, or just plain bad luck.If you base your goals on personal performance, then you can keep control over the achievement of your goals, and draw satisfaction from them.</li><li><strong>Set realistic goals –&nbsp;</strong>It\'s important to set goals that you can achieve. All sorts of people (for example, employers, parents, media, or society) can set unrealistic goals for you. They will often do this in ignorance of your own desires and ambitions.It\'s also possible to set goals that are too difficult because you might not appreciate either the obstacles in the way, or understand quite how much skill you need to develop to achieve a particular level of performance.</li></ul>\n<!-- /wp:list -->","My goals","","publish","closed","closed","","my-goals","","","2018-12-14 08:22:35","2018-12-14 08:22:35","",17,"http://tory-wordpress-site.local/?page_id=25",2,"page","",0),
