(28,1,"2018-12-13 12:02:33","2018-12-13 12:02:33","<!-- wp:paragraph -->\n<p>When you\'ve achieved a goal, take the time to enjoy the satisfaction of having done so. Absorb the implications of the goal achievement, and observe the progress that you\'ve made towards other goals.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If the goal was a significant one, reward yourself appropriately. All of this helps you build the self-confidence you deserve.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>With the experience of having achieved this goal, review the rest of your goal plans:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>If you achieved the goal too easily, make your next goal harder.</li><li>If the goal took a dispiriting length of time to achieve, make the next goal a little easier.</li><li>If you learned something that would lead you to change other goals, do so.</li><li>If you noticed a deficit in your skills despite achieving the goal, decide whether to set goals to fix this.</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>Tip 1:</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Our article,&nbsp;<a href=\"https://www.mindtools.com/pages/article/newHTE_90.htm\">Golden Rules of Goal Setting</a>&nbsp;, will show you how to set yourself up for success when it comes to your goals. If you\'re still having trouble, you might also want to try&nbsp;<a href=\"https://www.mindtools.com/pages/article/newHTE_84.htm\">Backward Goal Setting</a>&nbsp;.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>Tip 2:</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>It\'s important to remember that failing to meet goals does not matter much, just as long as you learn from the experience.</p>\n<!-- /wp:paragraph -->","Cookie policy","","publish","closed","closed","","cookie-policy","","","2018-12-13 12:02:33","2018-12-13 12:02:33","",19,"http://tory-wordpress-site.local/?page_id=28",0,"page","",0),
